import PropTypes from "prop-types";

import "./GoalDisplay.scss";

export const GoalDisplay = ({ isCardio, goal }) => {
  console.log(goal);
  return (
    <div className="pt-4">
      <div className="GoalContainer">
        {isCardio ? (
          <div>{goal.duration}</div>
        ) : (
          <>
            <h3 className="SetsTitle">Sets</h3>
            <h3 className="RepsTitle">Reps</h3>
            <h3 className="WeightTitle">Weight</h3>
            <h2 className="SetsCol">{goal.sets}</h2>
            <h2 className="RepsCol">{`${goal.min_reps}-${goal.max_reps}`}</h2>
            <h2 className="WeightCol">{goal.weight} lbs</h2>
          </>
        )}
      </div>
    </div>
  );
};

GoalDisplay.propTypes = {
  isCardio: PropTypes.bool,
  goal: PropTypes.object,
};
